import React from "react";

export const FlowerCartSummary = () => {
  return (
    <container className="Flowers__Cart__PositionContainer">
      <img
        src="https://www.kwiatowadostawa.pl/userdata/gfx/6673ef06705eda8ca3aa005170a4d600.jpg"
        alt=""
      />
      <article>
        Flower
        <div className="Flowers__Cart__PositionContainer--Info">
          <span>13 flower x1</span>
          <span>28.55$</span>
        </div>
      </article>

      <div className="Flowers__Cart__PositionContainer--CloseButton"></div>
    </container>
  );
};
